function fn_is_img(str_url){
    let ary_str_split=str_url.split('.');
    let ex=ary_str_split.slice(-1)[0];
    switch (ex.toLowerCase()){
        case "jpg":
        case "jpeg":
        case "png":
        case "gif":
        case "bmp":
        case "ico":
        case "webp":
        case "svg":
        case "avif":
            return true;
    }return false;
}
